sys_variable_value.value:
(function execute(inputs, outputs) {
  	var xmlDoc = new XMLDocument2();
	xmlDoc.parseXML(inputs.response);
  	var status = xmlDoc.getFirstNode('//TrackDetails/Notification/Severity').getTextContent();
  	outputs.status = status;
  	if (status == 'SUCCESS') {
      	outputs.delivery_status = xmlDoc.getFirstNode('//TrackDetails/StatusDetail/Description').getTextContent();
  		outputs.projected_delivery_date = xmlDoc.getFirstNode('//EstimatedDeliveryTimestamp') ? xmlDoc.getFirstNode('//EstimatedDeliveryTimestamp').getTextContent() : '2020-07-23T12:17:38-05:00';
      	outputs.actual_delivery_timestamp = xmlDoc.getFirstNode('//ActualDeliveryTimestamp') ? xmlDoc.getFirstNode('//ActualDeliveryTimestamp').getTextContent() : '';
    } else {
      outputs.code = xmlDoc.getFirstNode('//TrackDetails/Notification/Code').getTextContent();
      outputs.message = xmlDoc.getFirstNode('//TrackDetails/Notification/Message').getTextContent();
    }
})(inputs, outputs);

